MATCH (d:Drug)-[:DrugHasIndication]->(dis:Disorder)
WHERE toLower(d.displayName) = toLower('Ropinirole')
RETURN dis.primaryDomainId AS disorderId, dis.displayName AS disorderName, dis.icd10 AS icd10Codes, dis.description AS disorderDescription;

MATCH (d:Drug)-[:DrugHasSideEffect]->(se:SideEffect)-[:SideEffectSameAsPhenotype]->(ph:Phenotype)
WHERE toLower(d.displayName) = toLower('Donepezil')
RETURN ph.primaryDomainId AS phenotypeId, ph.displayName AS phenotype;

MATCH (d:Drug)-[:DrugHasContraindication]->(dis:Disorder)
WHERE toLower(d.displayName) = toLower('Paroxetine')
RETURN dis.primaryDomainId AS disorderId, dis.displayName AS disorderName;

MATCH (d:Drug)-[:DrugHasContraindication]->(dis:Disorder)
WHERE toLower(d.displayName) = toLower('Paroxetine')
RETURN dis.primaryDomainId AS contraindicationId, dis.displayName AS contraindicationName;

MATCH (d:Drug)-[:DrugHasSideEffect]->(se:SideEffect)
WHERE toLower(d.displayName) = toLower('Paroxetine')
RETURN se.primaryDomainId AS sideEffectId, se.displayName AS sideEffectName;

MATCH (d:Drug)-[:DrugHasTarget]->(p:Protein)
WHERE toLower(d.displayName) = toLower('Imatinib')
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName;

MATCH (g:Gene)-[r:GeneAssociatedWithDisorder]->(dis:Disorder {primaryDomainId:'mondo.0016419'})
WHERE r.scoreOpenTargets IS NULL OR r.scoreOpenTargets > 0.3
RETURN g.primaryDomainId AS geneId, g.displayName AS geneName, dis.primaryDomainId AS disorderId, dis.displayName AS disorderName;

MATCH (dis:Disorder)
WHERE toLower(dis.displayName) = toLower('Wilson disease')
RETURN dis.primaryDomainId AS disorderId, dis.displayName AS disorderName, dis.icd10 AS icd10Codes;

MATCH (dis:Disorder)-[:DisorderHasPhenotype]->(ph:Phenotype) 
WHERE dis.primaryDomainId IN ['mondo.0018266','mondo.0008840','mondo.0008841','mondo.0024557','mondo.0014399'] 
RETURN ph.primaryDomainId AS phenotypeId, ph.displayName AS phenotypeName, ph.description AS clinicalDescription;

MATCH (dis:Disorder) 
WHERE toLower(dis.displayName) = toLower('Alzheimer disease') 
RETURN dis.description AS description, dis.icd10 AS icd10;

MATCH (v:GenomicVariant)-[:VariantAssociatedWithDisorder]->(dis:Disorder {primaryDomainId:'mondo.0007254'})
WHERE v.variantType = 'SNV'
RETURN v.primaryDomainId AS variantId, v.displayName AS variantName, v.alternativeSequence, v.position, v.chromosome, v.referenceSequence, v.variantType, dis.primaryDomainId AS disorderId, dis.displayName AS disorderName;

MATCH (v:GenomicVariant)-[:VariantAssociatedWithDisorder]->(dis:Disorder {primaryDomainId:'mondo.0009061'})
WHERE v.chromosome = '7'
RETURN v.primaryDomainId AS variantId, v.referenceSequence AS referenceSequence, v.alternativeSequence AS alternativeSequence;

MATCH (v:GenomicVariant)-[:VariantAffectsGene]->(g:Gene)
WHERE v.chromosome = 'X' AND v.position = 30708057 AND v.alternativeSequence = 'A'
RETURN g.primaryDomainId AS geneId, g.displayName AS geneName;

MATCH (ph:Phenotype)
WHERE 'Global developmental delay' IN ph.synonyms
RETURN ph.primaryDomainId AS phenotypeId, ph.displayName AS phenotypeName, ph.description AS description, ph.dataSources AS dataSources;

MATCH (ph:Phenotype)
WHERE toLower(ph.displayName) CONTAINS toLower('onset')
RETURN ph.primaryDomainId AS phenotypeId, ph.displayName;

MATCH (ph:Phenotype)
WHERE toLower(ph.displayName) = toLower('Intellectual disability')
RETURN ph.primaryDomainId AS phId, ph.displayName AS phName, ph.synonyms AS synonyms, ph.description AS description;

MATCH (ph:Phenotype) 
WHERE toLower(ph.displayName) = toLower('Global developmental delay') 
RETURN ph.primaryDomainId AS phenotypeId, ph.displayName AS phenotypeName, ph.description AS description;

MATCH (ph:Phenotype {primaryDomainId:'hpo.0001252'})
MATCH (d:Disorder)-[:DisorderHasPhenotype]->(ph)
RETURN d.primaryDomainId AS disorderId, d.displayName AS disorderName;

MATCH (se:SideEffect)-[:SideEffectSameAsPhenotype]->(ph:Phenotype)
WHERE toLower(ph.displayName) CONTAINS 'nystagmus'
RETURN se.primaryDomainId AS sideEffectId, se.displayName AS sideEffectName, ph.primaryDomainId AS phenotypeId, ph.displayName AS phenotypeName;

MATCH (s:Signature)
WHERE toLower(s.displayName) = toLower('Calcitonin signature')
RETURN s.primaryDomainId AS signatureId, s.displayName AS signatureName, s.dataSources AS databaseSource;

MATCH (p:Protein)-[:ProteinHasSignature]->(s1:Signature), (p)-[:ProteinHasSignature]->(s2:Signature)
WHERE toLower(s1.displayName) = 'ig-like_dom' AND toLower(s2.displayName) = 'ig_like'
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName;

MATCH (s:Signature)
UNWIND s.dataSources AS db
RETURN db AS database, count(distinct s) AS signatureCount;

MATCH (s:Signature)
WHERE s.signatureType IS NOT NULL
RETURN DISTINCT s.signatureType AS type, head(collect(s.displayName)) AS exampleDisplayName;

MATCH (p:Protein)-[:ProteinHasSignature]->(sig:Signature)
WHERE toLower(sig.displayName) = toLower('Immunoglobulin')
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName, sig.primaryDomainId AS signatureId, sig.dataSources AS sourceDatabase;

MATCH (s:Signature)
WHERE toLower(s.displayName) = toLower('alpha_CA_VI')
RETURN s.primaryDomainId AS signatureId, s.displayName AS signatureName, s.dataSources AS dataSources;

MATCH (sub:GO)-[:GOIsSubtypeOfGO]->(parent:GO)
WHERE toLower(parent.displayName) = toLower('membrane')
RETURN sub.primaryDomainId AS id, sub.displayName AS name;

MATCH (c:GO)-[:GOIsSubtypeOfGO*1..]->(b:GO)
WHERE toLower(c.displayName) = toLower('cytoplasm')
RETURN b.primaryDomainId AS broaderGoId, b.displayName AS broaderGoName;

MATCH (p:GO)-[:GOIsSubtypeOfGO]->(c:GO)
WHERE toLower(p.displayName) = toLower('signal transduction')
RETURN c.primaryDomainId AS childId, c.displayName AS childName;

MATCH (p:Protein)-[:ProteinHasGOAnnotation]->(go:GO)
WHERE go.primaryDomainId IN ['go.0061024','go.0071709','go.0010324','go.0031090','go.0098552']
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName;

MATCH (p:Protein)-[:ProteinEncodedByGene]->(g:Gene)
WHERE p.primaryDomainId IN ['uniprot.B7ZA86','uniprot.V9HW98','uniprot.B4DJF2','uniprot.B4DJB0','uniprot.G9K388']
RETURN g.primaryDomainId AS geneId, g.displayName AS geneName;

MATCH (p:Protein)-[:ProteinHasSignature]->(s:Signature)
WHERE toLower(p.displayName) = toLower('CUL3_HUMAN')
RETURN s.primaryDomainId AS signatureId, s.displayName AS signatureName;

MATCH (p:Protein)
WHERE toLower(p.displayName) = toLower('EGFR')
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName, p.sequence AS aminoAcidSequence;

MATCH (p:Protein) 
WHERE toLower(p.displayName) = toLower('HSP7C') 
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName, p.synonyms AS synonyms;

MATCH (p1:Protein)-[:ProteinInteractsWithProtein]->(p2:Protein)
WHERE toLower(p1.displayName) = toLower('MYC_HUMAN')
RETURN p2.primaryDomainId AS proteinId, p2.displayName AS proteinName;

MATCH (p:Protein)-[:ProteinHasGOAnnotation]->(go:GO)
WHERE toLower(p.displayName) = toLower('P53')
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName, go.primaryDomainId AS goId, go.displayName AS goName, go.description AS goDescription;

MATCH (p:Protein)-[:ProteinEncodedByGene]->(g:Gene)
WHERE p.primaryDomainId IN ['uniprot.Q8WZA5','uniprot.A7VN05','uniprot.A0A068JCC9','uniprot.A0A068JD88','uniprot.A7VN07']
RETURN g.primaryDomainId AS geneId, g.displayName AS geneName;

MATCH (g:Gene)-[:GeneExpressedInTissue]->(t:Tissue)
WHERE toLower(t.displayName) = toLower('spleen')
RETURN count(DISTINCT g) AS geneCount;

MATCH (g:Gene)-[:GeneExpressedInTissue]->(t:Tissue)
WHERE toLower(t.displayName) = toLower('spleen')
RETURN g.primaryDomainId AS geneId, g.displayName AS geneName;

MATCH (g:Gene)
WHERE toLower(g.displayName) = toLower('TTN')
RETURN g.primaryDomainId AS gId, g.displayName AS gName, g.chromosome, g.geneType;

MATCH (p:Protein)-[:ProteinInPathway]->(pw:Pathway {primaryDomainId:'reactome.R-HSA-392499'})
WHERE toLower(p.is_reviewed) IN ['y','yes']
RETURN p.displayName AS proteinDisplayName;

MATCH (p:Protein)-[:ProteinInPathway]->(pa:Pathway)
WHERE pa.primaryDomainId IN ['reactome.R-HSA-5260271','reactome.R-HSA-1280215','reactome.R-HSA-9637628','reactome.R-HSA-168249','reactome.R-HSA-1280218']
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName, pa.primaryDomainId AS pathwayId, pa.displayName AS pathwayName;

MATCH (d:Drug)-[:DrugHasSideEffect]->(se:SideEffect)
WHERE toLower(se.displayName) CONTAINS 'nausea'
RETURN d.primaryDomainId AS drugId, d.displayName AS drugName;

MATCH (se:SideEffect)
WHERE toLower(se.displayName) = toLower('Headache')
RETURN se.primaryDomainId AS sideEffectId, se.displayName AS sideEffectName, se.dataSources AS dataSources;

MATCH (se:SideEffect)
WHERE toLower(se.displayName) = toLower('Abdominal pain')
RETURN se.primaryDomainId AS sideEffectId, se.displayName AS sideEffectName;
